{
  "name": "UBX-NAV-SOL",
  "class_id": "0x01",
  "message_id": "0x06",
  "description": "Navigation solution information",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 52
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "name": "fTOW",
      "data_type": "I4",
      "unit": "ns",
      "description": "Fractional part of iTOW (range: +/- 500000). The precise GPS time of week in seconds is: (iTOW * 1e-3) + (fTOW * 1e-9)"
    },
    {
      "byte_offset": 8,
      "name": "week",
      "data_type": "I2",
      "unit": "weeks",
      "description": "GPS week number of the navigation epoch"
    },
    {
      "byte_offset": 10,
      "name": "gpsFix",
      "data_type": "U1",
      "description": "GPSfix Type, range 0..5: 0x00 = No Fix, 0x01 = Dead Reckoning only, 0x02 = 2D-Fix, 0x03 = 3D-Fix, 0x04 = GPS + dead reckoning combined, 0x05 = Time only fix, 0x06..0xff: reserved"
    },
    {
      "byte_offset": 11,
      "name": "flags",
      "data_type": "X1",
      "description": "Fix Status Flags (see graphic below)"
    },
    {
      "byte_offset": 12,
      "name": "ecefX",
      "data_type": "I4",
      "unit": "cm",
      "description": "ECEF X coordinate"
    },
    {
      "byte_offset": 16,
      "name": "ecefY",
      "data_type": "I4",
      "unit": "cm",
      "description": "ECEF Y coordinate"
    },
    {
      "byte_offset": 20,
      "name": "ecefZ",
      "data_type": "I4",
      "unit": "cm",
      "description": "ECEF Z coordinate"
    },
    {
      "byte_offset": 24,
      "name": "pAcc",
      "data_type": "U4",
      "unit": "cm",
      "description": "3D Position Accuracy Estimate"
    },
    {
      "byte_offset": 28,
      "name": "ecefVX",
      "data_type": "I4",
      "unit": "cm/s",
      "description": "ECEF X velocity"
    },
    {
      "byte_offset": 32,
      "name": "ecefVY",
      "data_type": "I4",
      "unit": "cm/s",
      "description": "ECEF Y velocity"
    },
    {
      "byte_offset": 36,
      "name": "ecefVZ",
      "data_type": "I4",
      "unit": "cm/s",
      "description": "ECEF Z velocity"
    },
    {
      "byte_offset": 40,
      "name": "sAcc",
      "data_type": "U4",
      "unit": "cm/s",
      "description": "Speed Accuracy Estimate"
    },
    {
      "byte_offset": 44,
      "name": "PDOP",
      "data_type": "U2",
      "scale": {
        "multiplier": 0.01
      },
      "description": "Position DOP"
    },
    {
      "byte_offset": 46,
      "name": "reserved1",
      "data_type": "U1",
      "reserved": true,
      "description": "Reserved"
    },
    {
      "byte_offset": 47,
      "name": "numSV",
      "data_type": "U1",
      "description": "Number of SVs used in Nav Solution"
    },
    {
      "byte_offset": 48,
      "name": "reserved2",
      "data_type": {
        "array_of": "U1",
        "count": 4
      },
      "reserved": true,
      "description": "Reserved"
    }
  ]
}
